import { FETCH_FOODS } from "../constants/actionTypes"

export const foodsReducer = (state = { products: [] }, action) => {
  switch (action.type) {
    case FETCH_FOODS:        
      return { ...state,products: action.payload.data } 
      
    default:
      return state;
  }
};
